import React from "react";
import Books from "./pages/Books";
import Detail from "./pages/Detail";
import NoMatch from "./pages/NoMatch";
import Nav from "./components/Nav";

function App() {
  return (
    <div>
      <Nav />

      <Books exact path="/" component={Books} />
    </div>
  );
}

export default App;
